const Header = () => {
  return (
    <>
      <header>
        <div>
          Foodelicious
          <span>
            <FastfoodIcon />
          </span>
        </div>
        <button>
          Cart
          <span>
            <ShoppingCartIcon />
          </span>
        </button>
      </header>
      <div>
        <HeaderImage />
      </div>
    </>
  );
};

export default Header;
